import Product from './Product'



function Home() {

    return (
        <div>
            <div className="home">
                <div className="container ">

                    <div >
                        <Product

                            key ={1234}
                            title="Product title 1"
                            pricing={30}
                            qty ={1}
                            image='https://ng.jumia.is/unsafe/fit-in/680x680/filters:fill(white)/product/36/295128/1.jpg?3524'  
                        />


                </div>


            </div>



       </div></div>

    )
}

export default Home
